(2, 94, 'About izet', 'work-history', '<p><br /><strong>About iZET</strong></p>\r\n<p>IZET was \"born\" The Zetech International Centre for Entrepreneurship, Innovation and Technology Development (ICEITD) in September 2018. It was established as a multi-purpose \"vehicle\" with the aim of being a business and technology incubator for graduates and other citizens outside the university. As a center of excellence, ICEITD was expected to identify and develop entrepreneurs (in business, ICT, agribusiness and in other service sector) through capacity building and technology applications. The founders envisioned a Centre which was to play a key role of spurring Zetech students, graduates and faculty into being creative and innovative in their disciplines for the sustainable production of goods and services. Hence making their education more appropriate and resulting into employment generation. Through the Center, Zetech University was expected to contribute towards the countrys achievement of a number of Sustainable Development Goals (SDGs) specifically the First goal (elimination of poverty), the Fifth (gender equality) and the Eighth goal (decent work and economic growth) among others.</p>\r\n<p><br /><strong>VISION</strong></p>\r\n<p>To be an international hub center for promotion of innovation and technology-based entrepreneurship</p>\r\n<p><strong>MISSION</strong></p>\r\n<p>The Mission of the \"iZET hub\" as a Center of Excellence (and Incubator) within Zetech university is to identify, nurture and support the growth of new and existing enterprises including technology companies as well as the practical application of knowledge through inventions and commercialization; hence leading to job and wealth creation for a strong economic growth in Ruiru township and the country at large.</p>\r\n<p><strong>OBJECTIVES</strong></p>\r\n<ol style=\"list-style-type: lower-alpha;\">\r\n<li>To facilitate the creation of ideas and inventions that benefit society</li>\r\n<li>To ensure that the outcome of all Center Activities produce graduates that meet market demands  providing job opportunities and highly skilled inventors and entrepreneurs.</li>\r\n<li>Facilitate collaborations and partnerships with industry, academia and other institutions in the area of innovations</li>\r\n<li>To ensure smooth running of our training processes to promote technology-based entrepreneurship and thereby facilitate practical application of knowledge for public use.</li>\r\n</ol>', '', 1, 8, '2022-07-04 14:15:06', 236, '', '2022-07-15 11:36:41', 236, NULL, NULL, '2022-07-04 14:15:06', NULL, '{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 13, 3, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\"}', 1, '*', ''),
(3, 95, 'Education Background', 'education-background', '<h2><span class=\"subheading-category\">ACHIEVEMENTS OF THE INNOVATION CENTRE SO FAR</span></h2>\r\n<div class=\"item column-1\">\r\n<div class=\"page-header\">\r\n<h3>Ruiru Sub County MSME Baseline Survey conducted</h3>\r\n</div>\r\n<p>The overall objective of the Ruiru MSME Survey was to improve the knowledge base on the structure and performance of the Micro Small and Medium Enterprise sector in the urban and rural areas of Ruiru sub-county. The enterprises surveyed comprised of micro, small and medium enterprises domiciled in the 4 administrative wards of the sub-county i.e., Gitothua, Biashara, Gatongora and Kahawa Sukari wards. 930 respondents were interviewed against a targeted sample of 1000 respondents. The study concluded that the MSME sector plays a key role in the Ruiru Sub- County, and in the Kenyan economy at large. The sector was noted to have generated (and proved employment) to over 9000 individuals directly. It was also availing of essential goods and services to the residents, a majority of whom were employees/employers within Kiambu and Nairobi City Counties. Refer to the full report (provide the pdf format)</p>\r\n<p></p>\r\n<div class=\"item column-1\">\r\n<div class=\"page-header\">\r\n<h3>The Avocado Production and Marketing for Small Scale Farmers (AP&amp;MSCF) Consortium</h3>\r\n</div>\r\n<p>The Center was involved in the development of the Training Manual as well as coordinating the basic training and capacity building of farmers engaged in growing organic Hass Avocados from certified seedlings. Members of the Consortium include: Mofarm Fruits Exporters Jomo Kenyatta University of Agriculture and Technology, KEPHIS, Delphy Kenya, Equity Bank, Equity Foundation, Equity Insurance, Kakuzi, HCD, Farm Africa, Dynamics Marketing, Crop Nut, The Kenya National Chamber of Commerce and Industry Kiambu County and Elite Professionals Consortium and Zetech University.</p>\r\n<p>The main objective of the Consortium is to empower small scale avocado farmers in Kenya through various value adding interventions provided by the Consortia members in their areas of expertise and specialization. This covers all aspects in the Avocado value chain from the farm to the market place and finally the consumer. Over 500 farmers were reached within the Kiambu County and part of Muranga.</p>\r\n<p></p>\r\n<div class=\"item column-1\">\r\n<div class=\"page-header\">\r\n<h3>MobiQuick Ltd. student empowerment program.</h3>\r\n</div>\r\n<p>Conducted workshops and entrepreneurship forums for student empowerment in on business start-ups and growth. The overall objective was to train for mind-set change among students so as to become champions of job creation and self-employment. Over 75 students were trained.</p>\r\n<p></p>\r\n<div class=\"item column-1\">\r\n<div class=\"page-header\">\r\n<h3>Innovation Forums</h3>\r\n</div>\r\n<p>The Center successfully held several forums via zoom with the following organizations/institutions involved in the innovation and use of technology: Equity Group, Safaricom Ltd., Strathmore University, Jomo Kenyatta University of Agriculture and Technology and Kenyatta University. These were benchmarking strategies to learn from the leading innovative leaders corporate and academic sectors in the Kenya and the East African Region.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '', 1, 8, '2022-07-04 14:25:52', 236, '', '2022-07-15 11:55:30', 236, NULL, NULL, '2022-07-04 14:25:52', NULL, '{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 2, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\"}', 1, '*', ''),
(4, 96, 'Skills & Competencies', 'skills-competencies', '<p style=\"text-align: center;\"><img src=\"images/q5.png\" width=\"250\" height=\"50\" loading=\"lazy\" data-path=\"local-images:/q5.png\" /></p>\r\n<p style=\"text-align: center;\">Full stack Development (Python Flask, Postgresql, Sqlalchemy ORM)</p>\r\n<p style=\"text-align: center;\">Good Understanding and experience of both windows and linux operating systems</p>\r\n<p style=\"text-align: center;\">Good Troubleshooting Amplitude.</p>\r\n<p style=\"text-align: center;\">Good understanding of Networking Technologies.</p>\r\n<p style=\"text-align: center;\">Experience with Content Management Systems such as Wordpress.</p>\r\n<p style=\"text-align: center;\">Proficient in microsoft office, sharepoint</p>\r\n<p style=\"text-align: center;\">Python Programming - Flask framework, Web scraping - beautifulsoup</p>\r\n<p style=\"text-align: center;\">Web Technologies: HTML5,XML CSS, Javascript,, PHP and JSON</p>\r\n<p style=\"text-align: center;\">Experience with DB Management systems - Postgresql,Mysql, PhpMyAdmin</p>\r\n<p style=\"text-align: center;\">Excellent Communication Skills.</p>\r\n<p style=\"text-align: center;\">Self Driven and a team player.</p>', '', 1, 8, '2022-07-04 14:29:05', 236, '', '2022-07-04 14:31:03', 236, NULL, NULL, '2022-07-04 14:29:05', NULL, '{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"l