(11, 122, 'Testimonial1', 'testimonial1', '<blockquote>\r\n<p style=\"text-align: center;\">\"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful\"</p>\r\n</blockquote>', '', -2, 11, '2022-07-07 14:27:54', 236, '', '2022-07-08 05:20:02', 236, NULL, NULL, '2022-07-07 14:27:54', NULL, '{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 3, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\"}', 0, '*', ''),
(12, 124, 'Testimonial1 (2)', 'testimonial1-2', '<h3>The Avocado Production and Marketing for Small Scale Farmers (AP&amp;MSCF) Consortium</h3>\r\n<p>The Center was involved in the development of the Training Manual as well as coordinating the basic training and capacity building of farmers engaged in growing organic Hass Avocados from certified seedlings. Members of the Consortium include: Mofarm Fruits Exporters Jomo Kenyatta University of Agriculture and Technology, KEPHIS, Delphy Kenya, Equity Bank, Equity Foundation, Equity Insurance, Kakuzi, HCD, Farm Africa, Dynamics Marketing, Crop Nut, The Kenya National Chamber of Commerce and Industry Kiambu County and Elite Professionals Consortium and Zetech University.</p>\r\n<p>The main objective of the Consortium is to empower small scale avocado farmers in Kenya through various value adding interventions provided by the Consortia members in their areas of expertise and specialization. This covers all aspects in the Avocado value chain from the farm to the market place and finally the consumer. Over 500 farmers were reached within the Kiambu County and part of Muranga.</p>', '', 1, 9, '2022-07-07 14:27:54', 236, '', '2022-07-15 12:42:56', 236, NULL, NULL, '2022-07-07 14:27:54', NULL, '{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 12, 2, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\"}', 0, '*', ''),
(13, 125, 'Mobiquik ltd', 'mobiquik', '<h3>MobiQuick Ltd. student empowerment program.</h3>\r\n<p>Conducted workshops and entrepreneurship forums for student empowerment in on business start-ups and growth. The overall objective was to train for mind-set change among students so as to become champions of job creation and self-employment. Over 75 students were trained.</p>', '', 1, 9, '2022-07-07 14:27:54', 236, '', '2022-07-15 12:46:03', 236, NULL, NULL, '2022-07-07 14:27:54', NULL, '{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 1, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\"}', 0, '*', ''),
(14, 126, 'Innovation Forums', 'innovation-forums', '<h3>Innovation Forums</h3>\r\n<p>The Center successfully held several forums via zoom with the following organizations/institutions involved in the innovation and use of technology: Equity Group, Safaricom Ltd., Strathmore University, Jomo Kenyatta University of Agriculture and Technology and Kenyatta University. These were benchmarking strategies to learn from the leading innovative leaders corporate and academic sectors in the Kenya and the East African Region</p>', '', 1, 9, '2022-07-07 14:27:54', 236, '', '2022-07-15 12:49:52', 236, NULL, NULL, '2022-07-07 14:27:54', NULL, '{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 6, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\"}', 0, '*', ''),
(15, 154, 'Huawei Competitions', 'huawei-competitions', '<h3>Huawei Competitions</h3>\r\n<p><img src=\"images/huawai-competition-winners.jpg\" alt=\"\" width=\"808\" height=\"319\" class=\"left\" loading=\"lazy\" data-path=\"local-images:/huawai-competition-winners.jpg\" /></p>\r\n<p>In 2018- we had had a student by the name Kennedy Muthaura who emerged as the best students country wide in the 2018-2019 Huawei Competitions. He was recognized at a colorful ceremony that saw ICT and Innovation Principal Secretary Jerome Ochieng highlight the critical role IT&nbsp; and research plays in advancing the big four agenda.</p>\r\n', '\r\n<p>The competition is aimed at providing a platform for global ICT talents to: compete and grow their skills, promote high-quality ICT talent development and drive the growth of a sustainable ICT talent ecosystem.</p>\r\n<p><img src=\"images/kennedy-muthaura.jpg\" alt=\"\" width=\"808\" height=\"319\" loading=\"lazy\" data-path=\"local-images:/kennedy-muthaura.jpg\" /></p>\r\n<p>Adding to the victory, Zetech Universitys Trainer and Head of Centre for Professional Certification Samuel Kinuthia was recognised as the Best trainer while the institution beat competitors to win the Best Huawei ICT Academy award; the ceremony saw the University of Nairobi was recognized for being the longest service HAINA centre. In March 2019, Mr Kinuthia took 6 students to regional finals in South Africa for regional finals and in May 2019 he took 3 students to global finals in Shenzhen, China.</p>\r\n<p>Commenting on the achievement, Zetech VC Prof. Njenga Munene lauded Huawei and the higher education sector for their commitment to promote the use of ICT for education and the advancement of the country.</p>\r\n<p>\"As Zetech, we are proud of our student and trainer for the exemplary output displayed throughout the competition. As a Huawei certified academy, we are grateful to Huawei for the work they are doing in Kenya as we bank on technology to realise growth in Kenya and beyond.\" said Prof. Munene.</p>\r\n<p><img src=\"images/julius-kirimi.jpg\" alt=\"\" data-path=\"local-images:/julius-kirimi.jpg\" /></p>\r\n<p>In 2021, Our alumnus and valedictorian in the graduating class of 2021; Julius Kirimi emerged the second-best in the Huawei ICT Competition 2021-2022 (Cloud track) National finals. A total of 50 students contested in the Cloud Track category.</p>', 1, 9, '2022-07-15 13:01:34', 236, '', '2022-07-17 13:50:37', 236, 236, '2022-07-17 13:50:37', '2022-07-15 13:01:34', NULL, '{\"image_intro\":\"\",\"image_intro_alt\":\"\",\"float_intro\":\"left\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"float_fulltext\":\"left\",\"image_fulltext_caption\":\"\"}', '{\"urla\":\"\",\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":\"\",\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":\"\",\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 18, 0, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\"}', 1, '*', '');
