(57, 'index.php?option=com_content&view=article&id=11', 'index.php?option=com_content&view=article&id=11:testimonial1&catid=11', 'Testimonial1', ' \"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful\" ', '2022-07-08 05:20:02', 'b3cc56bbf12bf94506240b8a9eadece1', 1, 0, 1, '*', '2022-07-07 14:27:54', NULL, '2022-07-07 14:27:54', NULL, 0, 0, 3, ),
