(109, 'index.php?option=com_content&view=article&id=2', 'index.php?option=com_content&view=article&id=2:work-history&catid=8', 'About Izet', ' About iZET IZET was \"born\" The Zetech International Centre for Entrepreneurship, Innovation and Technology Development (ICEITD) in September 2018. It was established as a multi-purpose \"vehicle\" with the aim of being a business and technology incubator for graduates and other citizens outside the university. As a center of excellence, ICEITD was expected to identify and develop entrepreneurs (in business, ICT, agribusiness and in other service sector) through capacity building and technology applications. The founders envisioned a Centre which was to play a key role of spurring Zetech students, graduates and faculty into being creative and innovative in their disciplines for the sustainable production of goods and services. Hence making their education more appropriate and resulting into employment generation. Through the Center, Zetech University was expected to contribute towards the countrys achievement of a number of Sustainable Development Goals (SDGs) specifically the First goal (elimination of poverty), the Fifth (gender equality) and the Eighth goal (decent work and economic growth) among others. VISION To be an international hub center for promotion of innovation and technology-based entrepreneurship MISSION The Mission of the \"iZET hub\" as a Center of Excellence (and Incubator) within Zetech university is to identify, nurture and support the growth of new and existing enterprises including technology companies as well as the practical application of knowledge through inventions and commercialization; hence leading to job and wealth creation for a strong economic growth in Ruiru township and the country at large. OBJECTIVES To facilitate the creation of ideas and inventions that benefit society To ensure that the outcome of all Center Activities produce graduates that meet market demands  providing job opportunities and highly skilled inventors and entrepreneurs. Facilitate collaborations and partnerships with industry, academia and other institutions in the areaof innovations To ensure smooth running of our training processes to promote technology-based entrepreneurship and thereby facilitate practical application of knowledge for public use. ', '2022-07-15 11:36:41', '40ba792533d8a1f7c0ace17e97af41b1', 1, 1, 1, '*', '2022-07-04 14:15:06', NULL, '2022-07-04 14:15:06', NULL, 0, 0, 3, ),
(111, 'index.php?option=com_content&view=article&id=10', 'index.php?option=com_content&view=article&id=10:achievements&catid=9', 'ACHIEVEMENTS', '', '2022-07-15 11:40:04', '47ffb8058b918198525632c2f5d1794c', 1, 1, 1, '*', '2022-07-06 09:59:59', NULL, '2022-07-06 09:59:59', NULL, 0, 0, 3, );
INSERT INTO `vmi0l_finder_links` (`link_id`, `url`, `route`, `title`, `description`, `indexdate`, `md5sum`, `published`, `state`, `access`, `language`, `publish_start_date`, `publish_end_date`, `start_date`, `end_date`, `list_price`, `sale_price`, `type_id`, `object`) VALUES
(115, 'index.php?option=com_content&view=article&id=3', 'index.php?option=com_content&view=article&id=3:education-background&catid=8', 'Education Background', ' ACHIEVEMENTS OF THE INNOVATION CENTRE SO FAR Ruiru Sub County MSME Baseline Survey conducted The overall objective of the Ruiru MSME Survey was to improve the knowledge base on the structure and performance of the Micro Small and Medium Enterprise sector in the urban and rural areas of Ruiru sub-county. The enterprises surveyed comprised of micro, small and medium enterprises domiciled in the 4 administrative wards of the sub-county i.e., Gitothua, Biashara, Gatongora and Kahawa Sukari wards. 930 respondents were interviewed against a targeted sample of 1000 respondents. The study concluded that the MSME sector plays a key role in the Ruiru Sub- County, and in the Kenyan economy at large. The sector was noted to have generated (and proved employment) to over 9000 individuals directly. It was also availing of essential goods and services to the residents, a majority of whom were employees/employers within Kiambu and Nairobi City Counties. Refer to the full report (provide the pdf format) The Avocado Production and Marketing for Small Scale Farmers (AP&MSCF) Consortium The Center was involved in the development of the Training Manual as well as coordinating the basic training and capacity building of farmers engaged in growing organic Hass Avocados from certified seedlings. Members of the Consortium include: Mofarm Fruits Exporters Jomo Kenyatta University of Agriculture and Technology, KEPHIS, Delphy Kenya, Equity Bank, Equity Foundation, Equity Insurance, Kakuzi, HCD, Farm Africa, Dynamics Marketing, Crop Nut, The Kenya National Chamber of Commerce and Industry Kiambu County and Elite Professionals Consortium and Zetech University. The main objective of the Consortium is to empower small scale avocado farmers in Kenya through various value adding interventions provided by the Consortia members in their areas of expertise and specialization. This covers all aspects in the Avocado value chain from the farm to the market place and finally the consumer. Over 500 farmers werereached within the Kiambu County and part of Muranga. MobiQuick Ltd. student empowerment program. Conducted workshops and entrepreneurship forums for student empowerment in on business start-ups and growth. The overall objective was to train for mind-set change among students so as to become champions of job creation and self-employment. Over 75 students were trained. Innovation Forums The Center successfully held several forums via zoom with the following organizations/institutions involved in the innovation and use of technology: Equity Group, Safaricom Ltd., Strathmore University, Jomo Kenyatta University of Agriculture and Technology and Kenyatta University. These were benchmarking strategies to learn from the leading innovative leaders corporate and academic sectors in the Kenya and the East African Region. ', '2022-07-15 11:55:30', '8fa8c320868860a068e0b0cd9fa5f77d', 1, 1, 1, '*', '2022-07-04 14:25:52', NULL, '2022-07-04 14:25:52', NULL, 0, 0, 3, ),
(116, 'index.php?option=com_content&view=article&id=9', 'index.php?option=com_content&view=article&id=9:blog3&catid=9', 'BLOG 4', ' It is a long established fact that a reader will be distracted by the readable content of a page when looking at its layout. The point of using Lorem Ipsum is that it has a more-or-less normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like). ', '2022-07-15 12:00:15', '59402fc394f05c21e61b881aee0be1df', 1, 1, 1, '*', '2022-07-06 09:59:59', NULL, '2022-07-06 09:59:59', NULL, 0, 0, 3, );
