(158, 'index.php?option=com_content&view=article&id=15', 'index.php?option=com_content&view=article&id=15:huawei-competitions&catid=9', 'Huawei Competitions', ' Huawei Competitions In 2018- we had had a student by the name Kennedy Muthaura who emerged as the best students country wide in the 2018-2019 Huawei Competitions. He was recognized at a colorful ceremony that saw ICT and Innovation Principal Secretary Jerome Ochieng highlight the critical role IT and research plays in advancing the big four agenda. ', '2022-07-17 13:50:37', '666f2d1148e6f585317e5daf12513a18', 1, 1, 1, '*', '2022-07-15 13:01:34', NULL, '2022-07-15 13:01:34', NULL, 0, 0, 3, );
