(71, 'com_content.article.2', '', '2022-07-15 06:23:49', 236, 4078, '5bcdb184a19d5806e7d17da6d660e12b0dddfdd4', '{\"id\":\"2\",\"asset_id\":94,\"title\":\"About izet\",\"alias\":\"work-history\",\"introtext\":\"<h3><strong>About iZET<\\/strong><\\/h3>\\r\\n<hr \\/>\\r\\n<p>IZET was \\\"born\\\" The Zetech International Centre for Entrepreneurship, Innovation and Technology Development (ICEITD) in September 2018. It was established as a multi-purpose \\\"vehicle\\\" with the aim of being a business and technology incubator for graduates and other citizens outside the university. As a center of excellence, ICEITD was expected to identify and develop entrepreneurs (in business, ICT, agribusiness and in other service sector) through capacity building and technology applications. The founders envisioned a Centre which was to play a key role of spurring Zetech students, graduates and faculty into being creative and innovative in their disciplines for the sustainable production of goods and services. Hence making their education more appropriate and resulting into employment generation. Through the Center, Zetech University was expected to contribute towards the country\\u2019s achievement of a number of Sustainable Development Goals (SDGs) specifically the First goal (elimination of poverty), the Fifth (gender equality) and the Eighth goal (decent work and economic growth) among others.<\\/p>\\r\\n<h3><br \\/><strong>VISION<\\/strong><\\/h3>\\r\\n<p>To be an international hub center for promotion of innovation and technology-based entrepreneurship<\\/p>\\r\\n<h3><strong>MISSION<\\/strong><\\/h3>\\r\\n<p>The Mission of the \\\"iZET hub\\\" as a Center of Excellence (and Incubator) within Zetech university is to identify, nurture and support the growth of new and existing enterprises including technology companies as well as the practical application of knowledge through inventions and commercialization; hence leading to job and wealth creation for a strong economic growth in Ruiru township and the country at large.<\\/p>\\r\\n<h3><strong>OBJECTIVES<\\/strong><\\/h3>\\r\\n<p>\\u00a0 \\u00a0 To facilitate the creation of ideas and inventions that benefit society<br \\/>\\u00a0 \\u00a0 To ensure that the outcome of all Center Activities produce graduates that meet market demands \\u2013 providing job opportunities and highly skilled inventors and entrepreneurs.<br \\/>\\u00a0 \\u00a0 Facilitate collaborations and partnerships with industry, academia and other institutions in the area of innovations<br \\/>\\u00a0 \\u00a0 To ensure smooth running of our training processes to promote technology-based entrepreneurship and thereby facilitate practical application of knowledge for public use<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":8,\"created\":\"2022-07-04 14:15:06\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-15 06:23:49\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-15 06:18:57\",\"publish_up\":\"2022-07-04 14:15:06\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":2,\"ordering\":3,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\"}\",\"featured\":\"1\",\"language\":\"*\",\"note\":\"\"}', 0),
(72, 'com_content.article.2', '', '2022-07-15 07:37:21', 236, 4081, 'e6456580822c2b90c1a31b925a9468cfcd9957a9', '{\"id\":\"2\",\"asset_id\":94,\"title\":\"About izet\",\"alias\":\"work-history\",\"introtext\":\"<h3><strong>About iZET<\\/strong><\\/h3>\\r\\n<hr \\/>\\r\\n<p>sssIZET was \\\"born\\\" The Zetech International Centre for Entrepreneurship, Innovation and Technology Development (ICEITD) in September 2018. It was established as a multi-purpose \\\"vehicle\\\" with the aim of being a business and technology incubator for graduates and other citizens outside the university. As a center of excellence, ICEITD was expected to identify and develop entrepreneurs (in business, ICT, agribusiness and in other service sector) through capacity building and technology applications. The founders envisioned a Centre which was to play a key role of spurring Zetech students, graduates and faculty into being creative and innovative in their disciplines for the sustainable production of goods and services. Hence making their education more appropriate and resulting into employment generation. Through the Center, Zetech University was expected to contribute towards the country\\u2019s achievement of a number of Sustainable Development Goals (SDGs) specifically the First goal (elimination of poverty), the Fifth (gender equality) and the Eighth goal (decent work and economic growth) among others.<\\/p>\\r\\n<h3><br \\/><strong>VISION<\\/strong><\\/h3>\\r\\n<p>To be an international hub center for promotion of innovation and technology-based entrepreneurship<\\/p>\\r\\n<h3><strong>MISSION<\\/strong><\\/h3>\\r\\n<p>The Mission of the \\\"iZET hub\\\" as a Center of Excellence (and Incubator) within Zetech university is to identify, nurture and support the growth of new and existing enterprises including technology companies as well as the practical application of knowledge through inventions and commercialization; hence leading to job and wealth creation for a strong economic growth in Ruiru township and the country at large.<\\/p>\\r\\n<h3><strong>OBJECTIVES<\\/strong><\\/h3>\\r\\n<p>\\u00a0 \\u00a0 To facilitate the creation of ideas and inventions that benefit society<br \\/>\\u00a0 \\u00a0 To ensure that the outcome of all Center Activities produce graduates that meet market demands \\u2013 providing job opportunities and highly skilled inventors and entrepreneurs.<br \\/>\\u00a0 \\u00a0 Facilitate collaborations and partnerships with industry, academia and other institutions in the area of innovations<br \\/>\\u00a0 \\u00a0 To ensure smooth running of our training processes to promote technology-based entrepreneurship and thereby facilitate practical application of knowledge for public use<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":8,\"created\":\"2022-07-04 14:15:06\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-15 07:37:21\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-15 07:37:13\",\"publish_up\":\"2022-07-04 14:15:06\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":5,\"ordering\":3,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\"}\",\"featured\":\"1\",\"language\":\"*\",\"note\":\"\"}', 0),
(73, 'com_content.article.2', '', '2022-07-15 08:59:24', 236, 4076, 'f0d96c6b3482e397a4927722ed60250a66dc9746', '{\"id\":\"2\",\"asset_id\":94,\"title\":\"About izet\",\"alias\":\"work-history\",\"introtext\":\"<p><strong>About iZET<\\/strong><\\/p>\\r\\n<hr \\/>\\r\\n<p>IZET was \\\"born\\\" The Zetech International Centre for Entrepreneurship, Innovation and Technology Development (ICEITD) in September 2018. It was established as a multi-purpose \\\"vehicle\\\" with the aim of being a business and technology incubator for graduates and other citizens outside the university. As a center of excellence, ICEITD was expected to identify and develop entrepreneurs (in business, ICT, agribusiness and in other service sector) through capacity building and technology applications. The founders envisioned a Centre which was to play a key role of spurring Zetech students, graduates and faculty into being creative and innovative in their disciplines for the sustainable production of goods and services. Hence making their education more appropriate and resulting into employment generation. Through the Center, Zetech University was expected to contribute towards the country\\u2019s achievement of a number of Sustainable Development Goals (SDGs) specifically the First goal (elimination of poverty), the Fifth (gender equality) and the Eighth goal (decent work and economic growth) among others.<\\/p>\\r\\n<h3><br \\/><strong>VISION<\\/strong><\\/h3>\\r\\n<p>To be an international hub center for promotion of innovation and technology-based entrepreneurship<\\/p>\\r\\n<h3><strong>MISSION<\\/strong><\\/h3>\\r\\n<p>The Mission of the \\\"iZET hub\\\" as a Center of Excellence (and Incubator) within Zetech university is to identify, nurture and support the growth of new and existing enterprises including technology companies as well as the practical application of knowledge through inventions and commercialization; hence leading to job and wealth creation for a strong economic growth in Ruiru township and the country at large.<\\/p>\\r\\n<h3><strong>OBJECTIVES<\\/strong><\\/h3>\\r\\n<p>\\u00a0 \\u00a0 To facilitate the creation of ideas and inventions that benefit society<br \\/>\\u00a0 \\u00a0 To ensure that the outcome of all Center Activities produce graduates that meet market demands \\u2013 providing job opportunities and highly skilled inventors and entrepreneurs.<br \\/>\\u00a0 \\u00a0 Facilitate collaborations and partnerships with industry, academia and other institutions in the area of innovations<br \\/>\\u00a0 \\u00a0 To ensure smooth running of our training processes to promote technology-based entrepreneurship and thereby facilitate practical application of knowledge for public use<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":8,\"created\":\"2022-07-04 14:15:06\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-15 08:59:24\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-15 08:59:08\",\"publish_up\":\"2022-07-04 14:15:06\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_au