nship and the country at large.<\\/p>\\r\\n<p><strong>OBJECTIVES<\\/strong><\\/p>\\r\\n<p>\\u00a0 \\u00a0 To facilitate the creation of ideas and inventions that benefit society<br \\/>\\u00a0 \\u00a0 To ensure that the outcome of all Center Activities produce graduates that meet market demands \\u2013 providing job opportunities and highly skilled inventors and entrepreneurs.<br \\/>\\u00a0 \\u00a0 Facilitate collaborations and partnerships with industry, academia and other institutions in the area of innovations<br \\/>\\u00a0 \\u00a0 To ensure smooth running of our training processes to promote technology-based entrepreneurship and thereby facilitate practical application of knowledge for public use<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":8,\"created\":\"2022-07-04 14:15:06\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-15 11:29:19\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-15 11:23:04\",\"publish_up\":\"2022-07-04 14:15:06\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\