(77, 'com_content.article.2', '', '2022-07-15 11:32:37', 236, 4075, 'c9f82ac204d38ab081def2845a48c77c29a839a6', '{\"id\":\"2\",\"asset_id\":94,\"title\":\"About izet\",\"alias\":\"work-history\",\"introtext\":\"<p><br \\/><strong>About iZET<\\/strong><\\/p>\\r\\n<p>IZET was \\\"born\\\" The Zetech International Centre for Entrepreneurship, Innovation and Technology Development (ICEITD) in September 2018. It was established as a multi-purpose \\\"vehicle\\\" with the aim of being a business and technology incubator for graduates and other citizens outside the university. As a center of excellence, ICEITD was expected to identify and develop entrepreneurs (in business, ICT, agribusiness and in other service sector) through capacity building and technology applications. The founders envisioned a Centre which was to play a key role of spurring Zetech students, graduates and faculty into being creative and innovative in their disciplines for the sustainable production of goods and services. Hence making their education more appropriate and resulting into employment generation. Through the Center, Zetech University was expected to contribute towards the country\\u2019s achievement of a number of Sustainable Development Goals (SDGs) specifically the First goal (elimination of poverty), the Fifth (gender equality) and the Eighth goal (decent work and economic growth) among others.<\\/p>\\r\\n<p><br \\/><strong>VISION<\\/strong><\\/p>\\r\\n<p>To be an international hub center for promotion of innovation and technology-based entrepreneurship<\\/p>\\r\\n<p><strong>MISSION<\\/strong><\\/p>\\r\\n<p>The Mission of the \\\"iZET hub\\\" as a Center of Excellence (and Incubator) within Zetech university is to identify, nurture and support the growth of new and existing enterprises including technology companies as well as the practical application of knowledge through inventions and commercialization; hence leading to job and wealth creation for a strong economic growth in Ruiru township and the country at large.<\\/p>\\r\\n<p><strong>OBJECTIVES<\\/strong><\\/p>\\r\\n<ol style=\\\"list-style-type: lower-alpha;\\\">\\r\\n<li>To facilitate the creation of ideas and inventions that benefit society<\\/li>\\r\\n<li>To ensure that the outcome of all Center Activities produce graduates that meet market demands \\u2013 providing job opportunities and highly skilled inventors and entrepreneurs.<\\/li>\\r\\n<li>Facilitate collaborations and partnerships with industry, academia and other institutions in the area of innovations<\\/li>\\r\\n<li>To ensure smooth running of our training processes to promote technology-based entrepreneurship and thereby facilitate practical application of knowledge for public use.<\\/li>\\r\\n<\\/ol>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":8,\"created\":\"2022-07-04 14:15:06\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-15 11:32:37\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-15 11:31:49\",\"publish_up\":\"2022-07-04 14:15:06\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_aut