(80, 'com_content.article.3', '', '2022-07-15 11:42:04', 236, 2779, '2f65fe4820b90c1482f58c79d4194857154fb821', '{\"id\":\"3\",\"asset_id\":95,\"title\":\"Education Background\",\"alias\":\"education-background\",\"introtext\":\"<h2><span class=\\\"subheading-category\\\">ACHIEVEMENTS OF THE INNOVATION CENTRE SO FAR<\\/span><\\/h2>\\r\\n<div class=\\\"item column-1\\\">\\r\\n<div class=\\\"page-header\\\">\\r\\n<h3>Ruiru Sub County MSME Baseline Survey conducted<\\/h3>\\r\\n<\\/div>\\r\\n<p>The overall objective of the Ruiru MSME Survey was to improve the knowledge base on the structure and performance of the Micro Small and Medium Enterprise sector in the urban and rural areas of Ruiru sub-county. The enterprises surveyed comprised of micro, small and medium enterprises domiciled in the 4 administrative wards of the sub-county i.e., Gitothua, Biashara, Gatongora and Kahawa Sukari wards. 930 respondents were interviewed against a targeted sample of 1000 respondents. The study concluded that the MSME sector plays a key role in the Ruiru Sub- County, and in the Kenyan economy at large. The sector was noted to have generated (and proved employment) to over 9000 individuals directly. It was also availing of essential goods and services to the residents, a majority of whom were employees\\/employers within Kiambu and Nairobi City Counties. Refer to the full report (provide the pdf format)<\\/p>\\r\\n<\\/div>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":8,\"created\":\"2022-07-04 14:25:52\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-15 11:42:04\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-15 11:40:10\",\"publish_up\":\"2022-07-04 14:25:52\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":2,\"ordering\":2,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\"}\",\"featured\":\"1\",\"language\":\"*\",\"note\":\"\"}', 0),
(81, 'com_content.article.3', '', '2022-07-15 11:49:58', 236, 3980, '8b2c87184ac48d875b69fe4e7463437ec0d349d4', '{\"id\":\"3\",\"asset_id\":95,\"title\":\"Education Background\",\"alias\":\"education-background\",\"introtext\":\"<h2><span class=\\\"subheading-category\\\">ACHIEVEMENTS OF THE INNOVATION CENTRE SO FAR<\\/span><\\/h2>\\r\\n<div class=\\\"item column-1\\\">\\r\\n<div class=\\\"page-header\\\">\\r\\n<h3>Ruiru Sub County MSME Baseline Survey conducted<\\/h3>\\r\\n<\\/div>\\r\\n<p>The overall objective of the Ruiru MSME Survey was to improve the knowledge base on the structure and performance of the Micro Small and Medium Enterprise sector in the urban and rural areas of Ruiru sub-county. The enterprises surveyed comprised of micro, small and medium enterprises domiciled in the 4 administrative wards of the sub-county i.e., Gitothua, Biashara, Gatongora and Kahawa Sukari wards. 930 respondents were interviewed against a targeted sample of 1000 respondents. The study concluded that the MSME sector plays a key role in the Ruiru Sub- County, and in the Kenyan economy at large. The sector was noted to have generated (and proved employment) to over 9000 individuals directly. It was also availing of essential goods and services to the residents, a majority of whom were employees\\/employers within Kiambu and Nairobi City Counties. Refer to the full report (provide the pdf format)<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<div class=\\\"item column-1\\\">\\r\\n<div class=\\\"page-header\\\">\\r\\n<h3>The Avocado Production and Marketing for Small Scale Farmers (AP&amp;MSCF) Consortium<\\/h3>\\r\\n<\\/div>\\r\\n<p>The Center was involved in the development of the Training Manual as well as coordinating the basic training and capacity building of farmers engaged in growing organic Hass Avocados from certified seedlings. Members of the Consortium include: Mofarm Fruits Exporters Jomo Kenyatta University of Agriculture and Technology, KEPHIS, Delphy Kenya, Equity Bank, Equity Foundation, Equity Insurance, Kakuzi, HCD, Farm Africa, Dynamics Marketing, Crop Nut, The Kenya National Chamber of Commerce and Industry Kiambu County and Elite Professionals Consortium and Zetech University.<\\/p>\\r\\n<p>The main objective of the Consortium is to empower small scale avocado farmers in Kenya through various value adding interventions provided by the Consortia members in their areas of expertise and specialization. This covers all aspects in the Avocado value chain from the farm to the market place and finally the consumer. Over 500 farmers were reached within the Kiambu County and part of Muranga.<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":8,\"created\":\"2022-07-04 14:25:52\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-15 11:49:58\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-15 11:42:04\",\"publish_up\":\"2022-07-04 14:25:52\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":3,\"ordering\":2,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\"}\",\"featured\":\"1\",\"language\":\"*\",\"note\":\"\"}', 0),
(82, 'com_content.article.3', '', '2022-07-15 11:51:54', 236, 5007, 'ad1f6f1f8d0df53054fd6947f0367291dc6d29d2', '{\"id\":\"3\",\"asset_id\":95,\"title\":\"Education Background\",\"alias\":\"education-background\",\"introtext\":\"<h2><span class=\\\"subheading-category\\\">ACHIEVEMENTS OF THE INNOVATION CENTRE SO FAR<\\/span><\\/h2>\\r\\n<div class=\\\"item column-1\\\">\\r\\n<div class=\\\"page-header\\\">\\r\\n<h3>Ruiru Sub County MSME Baseline Survey conducted<\\/h3>\\r\\n<\\/div>\\r\\n<p>The overall objective of the Ruiru MSME Survey was to improve the knowledge base on the structure and performance of the Micro Small and Medium Enterprise sector in the urban and rural areas of Ruiru sub-county. The enterprises surveyed comprised of micro, small and medium enterprises domiciled in the 4 administrative wards of the sub-county i.e., Gitothua, Biashara, Gatongora and Kahawa Sukari wards. 930 respondents were interviewed against a targeted sample of 1000 respondents. The study concluded that the MSME sector plays a key role in the Ruiru Sub- County, and in the Kenyan economy at large. The sector was noted to have generated (and proved employment) to over 9000 individuals directly. It was also availing of essential goods and services to the residents, a majority of whom were employees\\/employers within Kiambu and Nairobi City Counties. Refer to the full report (provide the pdf format)<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<div class=\\\"item column-1\\\">\\r\\n<div class=\\\"page-header\\\">\\r\\n<h3>The Avocado Production and Marketing for Small Scale Farmers (AP&amp;MSCF) Consortium<\\/h3>\\r\\n<\\/div>\\r\\n<p>The Center was involved in the development of the Training Manual as well as coordinating the basic training and capacity building of farmers engaged in growing organic Hass Avocados from certified seedlings. Members of the Consortium include: Mofarm Fruits Exporters Jomo Kenyatta University of Agriculture and Technology, KEPHIS, Delphy Kenya, Equity Bank, Equity Foundation, Equity Insurance, Kakuzi, HCD, Farm Africa, Dynamics Marketing, Crop Nut, The Kenya National Chamber of Commerce and Industry Kiambu County and Elite Professionals Consortium and Zetech University.<\\/p>\\r\\n<p>The main objective of the Consortium is to empower small scale avocado farmers in Kenya through various value adding interventions provided by the Consortia members in their areas of expertise and specialization. This covers all aspects in the Avocado value chain from the farm to the market place and finally the consumer. Over 500 farmers were reached within the Kiambu County and part of Muranga.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<div class=\\\"item column-1\\\">\\r\\n<div class=\\\"page-header\\\">\\r\\n<h3>MobiQuick Ltd. student empowerment program.<\\/h3>\\r\\n<\\/div>\\r\\n<p>Conducted workshops and entrepreneurship forums for student empowerment in on business start-ups and growth. The overall objective was to train for mind-set change among students so as to become champions of job creation and self-employment. Over 75 students were trained.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<div class=\\\"item column-1\\\">\\r\\n<div class=\\\"page-header\\\">\\r\\n<h3>Innovation Forums<\\/h3>\\r\\n<\\/div>\\r\\n<p>The Center successfully held several forums via zoom with the following organizations\\/institutions involved in the innovation and use of technology: Equity Group, Safaricom Ltd., Strathmore University, Jomo Kenyatta University of Agriculture and Technology and Kenyatta University. These were benchmarking strategies to learn from the leading innovative leaders corporate and academic sectors in the Kenya and the East African Region.<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":8,\"created\":\"2022-07-04 14:25:52\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-15 11:51:54\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-15 11:49:58\",\"publish_up\":\"2022-07-04 14:25:52\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":4,\"ordering\":2,\"metakey\":\"\",\"metadesc\":\"\",\"access\":1,\"hits\":0,\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\"}\",\"featured\":\"1\",\"language\":\"*\",\"note\":\"\"}', 0),
