(86, 'com_content.article.8', '', '2022-07-15 12:13:59', 236, 2777, '601748c1574114ccf0a5771dfe874cd95893fe42', '{\"id\":\"8\",\"asset_id\":112,\"title\":\"Ruiru\",\"alias\":\"blog-2\",\"introtext\":\"<div class=\\\"titleheader\\\">Ruiru Sub County MSME Baseline Survey conducted<\\/div>\\r\\n<p>The overall objective of the Ruiru MSME Survey was to improve the knowledge base on the structure and performance of the Micro Small and Medium Enterprise sector in the urban and rural areas of Ruiru sub-county. The enterprises surveyed comprised of micro, small and medium enterprises domiciled in the 4 administrative wards of the sub-county i.e., Gitothua, Biashara, Gatongora and Kahawa Sukari wards. 930 respondents were interviewed against a targeted sample of 1000 respondents. The study concluded that the MSME sector plays a key role in the Ruiru Sub- County, and in the Kenyan economy at large. The sector was noted to have generated (and proved employment) to over 9000 individuals directly. It was also availing of essential goods and services to the residents, a majority of whom were employees\\/employers within Kiambu and Nairobi City Counties. Refer to the full report (provide the pdf format)<\\/p>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":9,\"created\":\"2022-07-05 11:19:12\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-15 12:13:59\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-15 12:10:40\",\"publish_up\":\"2022-07-05 11:19:12\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/imagesyy.png#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/imagesyy.png?width=290&height=174\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"top\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"images\\\\\\/imagesyy.png#joomlaImage:\\\\\\/\\\\\\/local-images\\\\\\/imagesyy.png?width=290&height=174\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"top\\\",\\\"image_fullt