(93, 'com_content.article.13', '', '2022-07-15 12:45:42', 236, 1938, '425790646352960745f993ed286fc881e1f7b138', '{\"id\":\"13\",\"asset_id\":125,\"title\":\"Mobiquik ltd\",\"alias\":\"mobiquik\",\"introtext\":\"<h3>MobiQuick Ltd. student empowerment program.\\u00a0<\\/h3>\\r\\n<p>Conducted workshops and entrepreneurship forums for student empowerment in on business start-ups and growth. The overall objective was to train for mind-set change among students so as to become champions of job creation and self-employment. Over 75 students were trained.<\\/p>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":9,\"created\":\"2022-07-07 14:27:54\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-15 12:45:42\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-15 12:45:06\",\"publish_up\":\"2022-07-07 14:27:54\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"s