(94, 'com_content.article.14', '', '2022-07-15 12:49:31', 236, 2082, 'a995c99538ceaf142c4a7300b8060a75dbf54dd3', '{\"id\":\"14\",\"asset_id\":126,\"title\":\"Innovation Forums\",\"alias\":\"innovation-forums\",\"introtext\":\"<h3>Innovation Forums<\\/h3>\\r\\n<p>The Center successfully held several forums via zoom with the following organizations\\/institutions involved in the innovation and use of technology: Equity Group, Safaricom Ltd., Strathmore University, Jomo Kenyatta University of Agriculture and Technology and Kenyatta University. These were benchmarking strategies to learn from the leading innovative leaders corporate and academic sectors in the Kenya and the East African Region<\\/p>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":9,\"created\":\"2022-07-07 14:27:54\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-15 12:49:31\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-15 12:48:07\",\"publish_up\":\"2022-07-07 14:27:54\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"