(101, 'com_content.article.15', '', '2022-07-17 13:08:58', 236, 2244, '3e6b4849b56d44d9520305cc2a8e14480147d914', '{\"id\":\"15\",\"asset_id\":154,\"title\":\"Huawei Competitions\",\"alias\":\"huawei-competitions\",\"introtext\":\"<h3>Huawei Competitions<\\/h3>\\r\\n<p>In 2018- we had had a student by the name Kennedy Muthaura who emerged as the best student\\u2019s country wide in the 2018-2019 Huawei Competitions. He was recognized at a colorful ceremony that saw ICT and Innovation Principal Secretary Jerome Ochieng highlight the critical role IT\\u00a0 and research plays in advancing the big four agenda. The competition is aimed at providing a platform for global ICT talents to: compete and grow their skills, promote high-quality ICT talent development and drive the growth of a sustainable ICT talent ecosystem.<\\/p>\\r\\n<p class=\\\"readmore\\\">\\u00a0<\\/p>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":9,\"created\":\"2022-07-15 13:01:34\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-17 13:08:58\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-17 13:07:10\",\"publish_up\":\"2022-07-15 13:01:34\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":