(102, 'com_content.article.15', '', '2022-07-17 13:14:36', 236, 3823, '4fefef1a979f7705c83a34b8d3f3406cb05b542f', '{\"id\":\"15\",\"asset_id\":154,\"title\":\"Huawei Competitions\",\"alias\":\"huawei-competitions\",\"introtext\":\"<h3>Huawei Competitions<\\/h3>\\r\\n<p>In 2018- we had had a student by the name Kennedy Muthaura who emerged as the best student\\u2019s country wide in the 2018-2019 Huawei Competitions. He was recognized at a colorful ceremony that saw ICT and Innovation Principal Secretary Jerome Ochieng highlight the critical role IT\\u00a0 and research plays in advancing the big four agenda. The competition is aimed at providing a platform for global ICT talents to: compete and grow their skills, promote high-quality ICT talent development and drive the growth of a sustainable ICT talent ecosystem.<\\/p>\\r\\n<p class=\\\"readmore\\\">He was Celebrated for recording the highest points in the tough competition, he represented the country in South Africa for regional finals. He was also gifted with an opportunity to do an internship at Huawei Kenya and a Huawei Matebook Pro to facilitate his work and learning experience.<\\/p>\\r\\n<p>Adding to the victory, Zetech University\\u2019s Trainer and Head of Centre for Professional Certification Samuel Kinuthia was recognised as the Best trainer while the institution beat competitors to win the Best Huawei ICT Academy award; the ceremony saw the University of Nairobi was recognized for being the longest service HAINA centre. In March 2019, Mr Kinuthia took 6 students to regional finals in South Africa for regional finals and in May 2019 he took 3 students to global finals in Shenzhen, China.<\\/p>\\r\\n<p>Commenting on the achievement, Zetech VC Prof. Njenga Munene lauded Huawei and the higher education sector for their commitment to promote the use of ICT for education and the advancement of the country.<\\/p>\\r\\n<p>\\\"As Zetech, we are proud of our student and trainer for the exemplary output displayed throughout the competition. As a Huawei certified academy, we are grateful to Huawei for the work they are doing in Kenya as we bank on technology to realise growth in Kenya and beyond.\\\" said Prof. Munene.<\\/p>\\r\\n<p>In 2021, Our alumnus and valedictorian in the graduating class of 2021; Julius Kirimi emerged the second-best in the Huawei ICT Competition 2021-2022 (Cloud track) National finals. A total of 50 students contested in the Cloud Track category.<\\/p>\",\"fulltext\":\"\",\"state\":\"1\",\"catid\":9,\"created\":\"2022-07-15 13:01:34\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-17 13:14:36\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-17 13:12:25\",\"publish_up\":\"2022-07-15 13:01:34\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\