 advancement of the country.<\\/p>\\r\\n<p>\\\"As Zetech, we are proud of our student and trainer for the exemplary output displayed throughout the competition. As a Huawei certified academy, we are grateful to Huawei for the work they are doing in Kenya as we bank on technology to realise growth in Kenya and beyond.\\\" said Prof. Munene.<\\/p>\\r\\n<p><img src=\\\"images\\/julius-kirimi.jpg\\\" alt=\\\"\\\" data-path=\\\"local-images:\\/julius-kirimi.jpg\\\" \\/><\\/p>\\r\\n<p>In 2021, Our alumnus and valedictorian in the graduating class of 2021; Julius Kirimi emerged the second-best in the Huawei ICT Competition 2021-2022 (Cloud track) National finals. A total of 50 students contested in the Cloud Track category.<\\/p>\",\"state\":\"1\",\"catid\":9,\"created\":\"2022-07-15 13:01:34\",\"created_by\":\"236\",\"created_by_alias\":\"\",\"modified\":\"2022-07-17 13:50:37\",\"modified_by\":236,\"checked_out\":236,\"checked_out_time\":\"2022-07-17 13:49:58\",\"publish_up\":\"2022-07-15 13:01:34\",\"publish_down\":null,\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"float_intro\\\":\\\"left\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"left\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":\\\"\\\",\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":\\\"\\\",\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":\\\"\\\",\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_cr