(127, 132, 'About izet', '', '<p><span style=\"font-size: 18px;\"><strong>About iZET</strong></span></p>\r\n<hr />\r\n<p><span style=\"font-size: 14px;\">IZET was \"born\" The Zetech International Centre for Entrepreneurship, Innovation and Technology Development (ICEITD) in September 2018. It was established as a multi-purpose \"vehicle\" with the aim of being a business and technology incubator for graduates and other citizens outside the university. As a center of excellence, ICEITD was expected to identify and develop entrepreneurs (in business, ICT, agribusiness and in other service sector) through capacity building and technology applications. The founders envisioned a Centre which was to play a key role of spurring Zetech students, graduates and faculty into being creative and innovative in their disciplines for the sustainable production of goods and services. Hence making their education more appropriate and resulting into employment generation. Through the Center, Zetech University was expected to contribute towards the countrys achievement of a number of Sustainable Development Goals (SDGs) specifically the First goal (elimination of poverty), the Fifth (gender equality) and the Eighth goal (decent work and economic growth) among others.</span></p>\r\n<p><br /><span style=\"font-size: 18px;\"><strong>VISION</strong></span></p>\r\n<p><span style=\"font-size: 14px;\">To be an international hub center for promotion of innovation and technology-based entrepreneurship</span></p>\r\n<p><span style=\"font-size: 18px;\"><strong>MISSION</strong></span></p>\r\n<p><span style=\"font-size: 14px;\">The Mission of the \"iZET hub\" as a Center of Excellence (and Incubator) within Zetech university is to identify, nurture and support the growth of new and existing enterprises including technology companies as well as the practical application of knowledge through inventions and commercialization; hence leading to job and wealth creation for a strong economic growth in Ruiru township and the country at large.</span></p>\r\n<p><span style=\"font-size: 18px;\"><strong>OBJECTIVES</strong></span></p>\r\n<p> <span style=\"font-size: 14px;\"> To facilitate the creation of ideas and inventions that benefit society</span><br /><span style=\"font-size: 14px;\">  To ensure that the outcome of all Center Activities produce graduates that meet market demands  providing job opportunities and highly skilled inventors and entrepreneurs.</span><br /><span style=\"font-size: 14px;\">  Facilitate collaborations and partnerships with industry, academia and other institutions in the area of innovations</span><br /><span style=\"font-size: 14px;\">  To ensure smooth running of our training processes to promote technology-based entrepreneurship and thereby facilitate practical application of knowledge for public use</span></p>', 1, 'mission', NULL, NULL, '2022-07-13 06:49:50', NULL, 0, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"btn text-secondary\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
